import React, { useState } from "react";

import "./SearchPost.css";

const SearchPost = (props) => {
  const [searchToggle, setSearchToggle] = useState(props.searchToggle);
  return (
    <div className="searchPostContainer" style={{ display: searchToggle }}>
      <button
        className="searchOffBtn"
        onClick={() => {
          setSearchToggle("none");
        }}
      >
        닫기
      </button>
      <input type="text" />
      <div>입력 후 엔터를 눌러주세요</div>
    </div>
  );
};

export default SearchPost;
